settings.custom_liquid:
{%- if product.metafields.custom.downloadable_contents -%}
                  {%- assign downloadable_contents = product.metafields.custom.downloadable_contents.value -%}
                  <p>Downloadable Contents</p>
                  <div class="test-grid">
                    {% for content in downloadable_contents %}
                      <a class="downloadable-content" href="{{ content.url }}" target="_blank">{{ content.title }}</a>
                    {% endfor %}
                  </div>
                {%- endif -%}

{% if product.metafields.custom.downloadable_file != blank %}
<a href="{{ product.metafields.custom.downloadable_file | file_url }}" style="color: #f44343;" target="_blank">
Download Manual
</a>
{% endif %}

{%- if product.metafields.custom.downloadable_contents -%}
                  {%- assign downloadable_contents = product.metafields.custom.downloadable_contents.value -%}

<div class="content-container">                  <p>Downloadable Contents</p>
                  <div class="test-grid">
                    {% for content in downloadable_contents %}
                      <a class="downloadable-content" href="{{ content.url }}" target="_blank">{{ content.title }}</a>
                    {% endfor %}
                  </div>
</div>
                {%- endif -%}

{% for order in customer.orders %}
        <div style="display: flex;">
          <div style="flex: 4 1 auto;">ORDER # {{ order.id }}</div>
          <div style="flex: 4 1 auto">
            SHIP TO<br>
            <span style="font-weight: 900;">{{ order.shipping_address }}</span>
          </div>
          <div style="flex: 1 1 auto">
            ORDER PLACED<br>
            <span style="font-weight: 900;">{{ order.created_at | date: '%B %d, %Y' }}</span>
          </div>
          <div style="flex: 1 1 auto">
            TOTAL<br>
            {{ order.total_price | money_with_currency }}
          </div>
          <div style="flex: 1 1 auto">
            OUTSTANDING PAYMENT <br>
            {{ order.total_duties }}
          </div>
        </div>
        {% for line_item in order.line_items %}
          <p
            {% if forloop.last == true %}
              style="margin-bottom: 8rem;"
            {% endif %}
          >
            {{ line_item.title }}
          </p>
        {% endfor %}
      {% endfor %}
